import React, {Component} from 'react';
import {Container, Box, Typography} from '@material-ui/core';
class LogIn extends Component {
    render() {
        return(
            <Container maxWidth="sm" >
                <Box bgcolor = "" 
                textAlig="center"
                p="24px"
                mt="50px"
                boxShadow="2"
                borderRadius="15px"
                >
                    <Typography variant="h5">Login</Typography>

                </Box>

            </Container>
        );

    }
}

export default LogIn;
